// Caso exista no Local Storage, recupera os dados salvos
var db = JSON.parse(localStorage.getItem('db'));
if (!db) {
    db = dbfake
};

// Exibe mensagem em um elemento de ID msg
function displayMessage(msg) {
    $('.msg').html('<div class="alert alert-warning">' + msg + '</div>');
}

function insertContato(contato) {
    // Calcula novo Id a partir do √∫ltimo c√≥digo existente no array
    let novoId = db.data[db.data.length - 1].id;
    ++novoId
    let novoContato = {
        "id": novoId,
        "nome": contato.nome,
        "endere√ßo": contato.endere√ßo,
        "telefone": contato.telefone, //n√£o mudar o √á
        "website": contato.website,
        "hora":contato.horario,
        "foto":contato.foto
        };

    // Insere o novo objeto no array
    db.data.push(novoContato);
    displayMessage("Contato inserido com sucesso");

    // Atualiza os dados no Local Storage
    localStorage.setItem('db', JSON.stringify(db));
}

function updateContato(id, contato) {
    // Localiza o indice do objeto a ser alterado no array a partir do seu ID
    let index = id-1;

    // Altera os dados do objeto no array
       
        db.data[index].endere√ßo = contato.endere√ßo,
        db.data[index].website = contato.website
        db.data[index].nome = contato.nome,
        db.data[index].hora = contato.hora,
        db.data[index].foto = contato.foto,

    displayMessage("Contato alterado com sucesso");

    // Atualiza os dados no Local Storage
    localStorage.setItem('db', JSON.stringify(db));
}

function deleteContato(id) {    
    // Filtra o array removendo o elemento com o id passado
    db.data = db.data.filter(function (element) { return element.id != id });

    displayMessage("Contato removido com sucesso");

    // Atualiza os dados no Local Storage
    localStorage.setItem('db', JSON.stringify(db));
}